@testset "1.2.1.3 (d+e x)^m (f+g x) (a+b x+c x^2)^p" begin
    (A, B, a, b, c, d, e, f, g, m, p, x, ) = @variables A B a b c d e f g m p x

    #= ::Package:: =#

    #= ::Title:: =#
    #=Integrands*of*the*form*(e*x)^m*(f+g*x)*(a+b*x+c*x^2)^p=#


    #= ::Section::Closed:: =#
    #=Integrands*of*the*form*(e*x)^m*(f+g*x)*(a+b*x+c*x^2)^p*when*a=0=#


    #= ::Subsection::Closed:: =#
    #=Integrands*of*the*form*x^m*(A+B*x)*(b*x+c*x^2)^p=#


    #= ::Subsubsection::Closed:: =#
    #=p>0=#


    @test_int [x^m*(A + B*x)*(b*x + c*x^2), x, 2, (A*b*x^(2 + m))/(2 + m) + ((b*B + A*c)*x^(3 + m))/(3 + m) + (B*c*x^(4 + m))/(4 + m)]

    @test_int [x^3*(A + B*x)*(b*x + c*x^2), x, 2, (A*b*x^5)/5 + ((b*B + A*c)*x^6)/6 + (B*c*x^7)/7]
    @test_int [x^2*(A + B*x)*(b*x + c*x^2), x, 2, (A*b*x^4)/4 + ((b*B + A*c)*x^5)/5 + (B*c*x^6)/6]
    @test_int [x^1*(A + B*x)*(b*x + c*x^2), x, 2, (A*b*x^3)/3 + ((b*B + A*c)*x^4)/4 + (B*c*x^5)/5]
    @test_int [x^0*(A + B*x)*(b*x + c*x^2), x, 2, (A*b*x^2)/2 + ((b*B + A*c)*x^3)/3 + (B*c*x^4)/4]
    @test_int [((A + B*x)*(b*x + c*x^2))/x^1, x, 2, A*b*x + ((b*B + A*c)*x^2)/2 + (B*c*x^3)/3]
    @test_int [((A + B*x)*(b*x + c*x^2))/x^2, x, 2, (b*B + A*c)*x + (1/2)*B*c*x^2 + A*b*log(x)]
    @test_int [((A + B*x)*(b*x + c*x^2))/x^3, x, 2, -((A*b)/x) + B*c*x + (b*B + A*c)*log(x)]
    @test_int [((A + B*x)*(b*x + c*x^2))/x^4, x, 2, -(A*b)/(2*x^2) - (b*B + A*c)/x + B*c*log(x)]
    @test_int [((A + B*x)*(b*x + c*x^2))/x^5, x, 2, -(A*b)/(3*x^3) - (b*B + A*c)/(2*x^2) - (B*c)/x]
    @test_int [((A + B*x)*(b*x + c*x^2))/x^6, x, 2, -(A*b)/(4*x^4) - (b*B + A*c)/(3*x^3) - (B*c)/(2*x^2)]
    @test_int [((A + B*x)*(b*x + c*x^2))/x^7, x, 2, -(A*b)/(5*x^5) - (b*B + A*c)/(4*x^4) - (B*c)/(3*x^3)]
    @test_int [((A + B*x)*(b*x + c*x^2))/x^8, x, 2, -(A*b)/(6*x^6) - (b*B + A*c)/(5*x^5) - (B*c)/(4*x^4)]


    @test_int [x^m*(A + B*x)*(b*x + c*x^2)^2, x, 2, (A*b^2*x^(3 + m))/(3 + m) + (b*(b*B + 2*A*c)*x^(4 + m))/(4 + m) + (c*(2*b*B + A*c)*x^(5 + m))/(5 + m) + (B*c^2*x^(6 + m))/(6 + m)]

    @test_int [x^3*(A + B*x)*(b*x + c*x^2)^2, x, 2, (A*b^2*x^6)/6 + (b*(b*B + 2*A*c)*x^7)/7 + (c*(2*b*B + A*c)*x^8)/8 + (B*c^2*x^9)/9]
    @test_int [x^2*(A + B*x)*(b*x + c*x^2)^2, x, 2, (A*b^2*x^5)/5 + (b*(b*B + 2*A*c)*x^6)/6 + (c*(2*b*B + A*c)*x^7)/7 + (B*c^2*x^8)/8]
    @test_int [x^1*(A + B*x)*(b*x + c*x^2)^2, x, 2, (A*b^2*x^4)/4 + (b*(b*B + 2*A*c)*x^5)/5 + (c*(2*b*B + A*c)*x^6)/6 + (B*c^2*x^7)/7]
    @test_int [x^0*(A + B*x)*(b*x + c*x^2)^2, x, 2, (A*b^2*x^3)/3 + (b*(b*B + 2*A*c)*x^4)/4 + (c*(2*b*B + A*c)*x^5)/5 + (B*c^2*x^6)/6]
    @test_int [((A + B*x)*(b*x + c*x^2)^2)/x^1, x, 2, (1/2)*A*b^2*x^2 + (1/3)*b*(b*B + 2*A*c)*x^3 + (1/4)*c*(2*b*B + A*c)*x^4 + (1/5)*B*c^2*x^5]
    @test_int [((A + B*x)*(b*x + c*x^2)^2)/x^2, x, 2, -(((b*B - A*c)*(b + c*x)^3)/(3*c^2)) + (B*(b + c*x)^4)/(4*c^2)]
    @test_int [((A + B*x)*(b*x + c*x^2)^2)/x^3, x, 2, b*(b*B + 2*A*c)*x + (1/2)*c*(2*b*B + A*c)*x^2 + (1/3)*B*c^2*x^3 + A*b^2*log(x)]
    @test_int [((A + B*x)*(b*x + c*x^2)^2)/x^4, x, 2, -((A*b^2)/x) + c*(2*b*B + A*c)*x + (1/2)*B*c^2*x^2 + b*(b*B + 2*A*c)*log(x)]
    @test_int [((A + B*x)*(b*x + c*x^2)^2)/x^5, x, 2, -((A*b^2)/(2*x^2)) - (b*(b*B + 2*A*c))/x + B*c^2*x + c*(2*b*B + A*c)*log(x)]
    @test_int [((A + B*x)*(b*x + c*x^2)^2)/x^6, x, 2, -((A*b^2)/(3*x^3)) - (b*(b*B + 2*A*c))/(2*x^2) - (c*(2*b*B + A*c))/x + B*c^2*log(x)]
    @test_int [((A + B*x)*(b*x + c*x^2)^2)/x^7, x, 2, -((A*b^2)/(4*x^4)) - (b*(b*B + 2*A*c))/(3*x^3) - (c*(2*b*B + A*c))/(2*x^2) - (B*c^2)/x]
    @test_int [((A + B*x)*(b*x + c*x^2)^2)/x^8, x, 2, -((A*b^2)/(5*x^5)) - (b*(b*B + 2*A*c))/(4*x^4) - (c*(2*b*B + A*c))/(3*x^3) - (B*c^2)/(2*x^2)]


    @test_int [x^m*(A + B*x)*(b*x + c*x^2)^3, x, 2, (A*b^3*x^(4 + m))/(4 + m) + (b^2*(b*B + 3*A*c)*x^(5 + m))/(5 + m) + (3*b*c*(b*B + A*c)*x^(6 + m))/(6 + m) + (c^2*(3*b*B + A*c)*x^(7 + m))/(7 + m) + (B*c^3*x^(8 + m))/(8 + m)]

    @test_int [x^3*(A + B*x)*(b*x + c*x^2)^3, x, 2, (A*b^3*x^7)/7 + (b^2*(b*B + 3*A*c)*x^8)/8 + (b*c*(b*B + A*c)*x^9)/3 + (c^2*(3*b*B + A*c)*x^10)/10 + (B*c^3*x^11)/11]
    @test_int [x^2*(A + B*x)*(b*x + c*x^2)^3, x, 2, (A*b^3*x^6)/6 + (b^2*(b*B + 3*A*c)*x^7)/7 + (3*b*c*(b*B + A*c)*x^8)/8 + (c^2*(3*b*B + A*c)*x^9)/9 + (B*c^3*x^10)/10]
    @test_int [x^1*(A + B*x)*(b*x + c*x^2)^3, x, 2, (A*b^3*x^5)/5 + (b^2*(b*B + 3*A*c)*x^6)/6 + (3*b*c*(b*B + A*c)*x^7)/7 + (c^2*(3*b*B + A*c)*x^8)/8 + (B*c^3*x^9)/9]
    @test_int [x^0*(A + B*x)*(b*x + c*x^2)^3, x, 2, (A*b^3*x^4)/4 + (b^2*(b*B + 3*A*c)*x^5)/5 + (b*c*(b*B + A*c)*x^6)/2 + (c^2*(3*b*B + A*c)*x^7)/7 + (B*c^3*x^8)/8]
    @test_int [((A + B*x)*(b*x + c*x^2)^3)/x^1, x, 2, (A*b^3*x^3)/3 + (b^2*(b*B + 3*A*c)*x^4)/4 + (3*b*c*(b*B + A*c)*x^5)/5 + (c^2*(3*b*B + A*c)*x^6)/6 + (B*c^3*x^7)/7]
    @test_int [((A + B*x)*(b*x + c*x^2)^3)/x^2, x, 2, (b*(b*B - A*c)*(b + c*x)^4)/(4*c^3) - ((2*b*B - A*c)*(b + c*x)^5)/(5*c^3) + (B*(b + c*x)^6)/(6*c^3)]
    @test_int [((A + B*x)*(b*x + c*x^2)^3)/x^3, x, 2, -(((b*B - A*c)*(b + c*x)^4)/(4*c^2)) + (B*(b + c*x)^5)/(5*c^2)]
    @test_int [((A + B*x)*(b*x + c*x^2)^3)/x^4, x, 2, b^2*(b*B + 3*A*c)*x + (3/2)*b*c*(b*B + A*c)*x^2 + (1/3)*c^2*(3*b*B + A*c)*x^3 + (1/4)*B*c^3*x^4 + A*b^3*log(x)]
    @test_int [((A + B*x)*(b*x + c*x^2)^3)/x^5, x, 2, -((A*b^3)/x) + 3*b*c*(b*B + A*c)*x + (1/2)*c^2*(3*b*B + A*c)*x^2 + (1/3)*B*c^3*x^3 + b^2*(b*B + 3*A*c)*log(x)]
    @test_int [((A + B*x)*(b*x + c*x^2)^3)/x^6, x, 2, -((A*b^3)/(2*x^2)) - (b^2*(b*B + 3*A*c))/x + c^2*(3*b*B + A*c)*x + (1/2)*B*c^3*x^2 + 3*b*c*(b*B + A*c)*log(x)]
    @test_int [((A + B*x)*(b*x + c*x^2)^3)/x^7, x, 2, -((A*b^3)/(3*x^3)) - (b^2*(b*B + 3*A*c))/(2*x^2) - (3*b*c*(b*B + A*c))/x + B*c^3*x + c^2*(3*b*B + A*c)*log(x)]
    @test_int [((A + B*x)*(b*x + c*x^2)^3)/x^8, x, 2, -((A*b^3)/(4*x^4)) - (b^2*(b*B + 3*A*c))/(3*x^3) - (3*b*c*(b*B + A*c))/(2*x^2) - (c^2*(3*b*B + A*c))/x + B*c^3*log(x)]
    @test_int [((A + B*x)*(b*x + c*x^2)^3)/x^9, x, 2, -((A*b^3)/(5*x^5)) - (b^2*(b*B + 3*A*c))/(4*x^4) - (b*c*(b*B + A*c))/x^3 - (c^2*(3*b*B + A*c))/(2*x^2) - (B*c^3)/x]
    @test_int [((A + B*x)*(b*x + c*x^2)^3)/x^10, x, 2, -((A*b^3)/(6*x^6)) - (b^2*(b*B + 3*A*c))/(5*x^5) - (3*b*c*(b*B + A*c))/(4*x^4) - (c^2*(3*b*B + A*c))/(3*x^3) - (B*c^3)/(2*x^2)]
    @test_int [((A + B*x)*(b*x + c*x^2)^3)/x^11, x, 2, -((A*b^3)/(7*x^7)) - (b^2*(b*B + 3*A*c))/(6*x^6) - (3*b*c*(b*B + A*c))/(5*x^5) - (c^2*(3*b*B + A*c))/(4*x^4) - (B*c^3)/(3*x^3)]


    #= ::Subsubsection::Closed:: =#
    #=p<0=#


    @test_int [x^4*(d + e*x)/(b*x + c*x^2), x, 2, (b^2*(c*d - b*e)*x)/c^4 - (b*(c*d - b*e)*x^2)/(2*c^3) + ((c*d - b*e)*x^3)/(3*c^2) + (e*x^4)/(4*c) - (b^3*(c*d - b*e)*log(b + c*x))/c^5]
    @test_int [x^3*(d + e*x)/(b*x + c*x^2), x, 2, -((b*(c*d - b*e)*x)/c^3) + ((c*d - b*e)*x^2)/(2*c^2) + (e*x^3)/(3*c) + (b^2*(c*d - b*e)*log(b + c*x))/c^4]
    @test_int [x^2*(d + e*x)/(b*x + c*x^2), x, 2, ((c*d - b*e)*x)/c^2 + (e*x^2)/(2*c) - (b*(c*d - b*e)*log(b + c*x))/c^3]
    @test_int [x^1*(d + e*x)/(b*x + c*x^2), x, 2, (e*x)/c + ((c*d - b*e)*log(b + c*x))/c^2]
    @test_int [x^0*(d + e*x)/(b*x + c*x^2), x, 2, (d*log(x))/b - ((c*d - b*e)*log(b + c*x))/(b*c)]
    @test_int [(d + e*x)/(x^1*(b*x + c*x^2)), x, 2, -(d/(b*x)) - ((c*d - b*e)*log(x))/b^2 + ((c*d - b*e)*log(b + c*x))/b^2]
    @test_int [(d + e*x)/(x^2*(b*x + c*x^2)), x, 2, -d/(2*b*x^2) + (c*d - b*e)/(b^2*x) + (c*(c*d - b*e)*log(x))/b^3 - (c*(c*d - b*e)*log(b + c*x))/b^3]
    @test_int [(d + e*x)/(x^3*(b*x + c*x^2)), x, 2, -d/(3*b*x^3) + (c*d - b*e)/(2*b^2*x^2) - (c*(c*d - b*e))/(b^3*x) - (c^2*(c*d - b*e)*log(x))/b^4 + (c^2*(c*d - b*e)*log(b + c*x))/b^4]


    @test_int [x^5*(d + e*x)/(b*x + c*x^2)^2, x, 2, -((b*(2*c*d - 3*b*e)*x)/c^4) + ((c*d - 2*b*e)*x^2)/(2*c^3) + (e*x^3)/(3*c^2) + (b^3*(c*d - b*e))/(c^5*(b + c*x)) + (b^2*(3*c*d - 4*b*e)*log(b + c*x))/c^5]
    @test_int [x^4*(d + e*x)/(b*x + c*x^2)^2, x, 2, ((c*d - 2*b*e)*x)/c^3 + (e*x^2)/(2*c^2) - (b^2*(c*d - b*e))/(c^4*(b + c*x)) - (b*(2*c*d - 3*b*e)*log(b + c*x))/c^4]
    @test_int [x^3*(d + e*x)/(b*x + c*x^2)^2, x, 2, (e*x)/c^2 + (b*(c*d - b*e))/(c^3*(b + c*x)) + ((c*d - 2*b*e)*log(b + c*x))/c^3]
    @test_int [x^2*(d + e*x)/(b*x + c*x^2)^2, x, 2, -((c*d - b*e)/(c^2*(b + c*x))) + (e*log(b + c*x))/c^2]
    @test_int [x^1*(d + e*x)/(b*x + c*x^2)^2, x, 2, (c*d - b*e)/(b*c*(b + c*x)) + (d*log(x))/b^2 - (d*log(b + c*x))/b^2]
    @test_int [x^0*(d + e*x)/(b*x + c*x^2)^2, x, 2, -(d/(b^2*x)) - (c*d - b*e)/(b^2*(b + c*x)) - ((2*c*d - b*e)*log(x))/b^3 + ((2*c*d - b*e)*log(b + c*x))/b^3]
    @test_int [(d + e*x)/(x^1*(b*x + c*x^2)^2), x, 2, -(d/(2*b^2*x^2)) + (2*c*d - b*e)/(b^3*x) + (c*(c*d - b*e))/(b^3*(b + c*x)) + (c*(3*c*d - 2*b*e)*log(x))/b^4 - (c*(3*c*d - 2*b*e)*log(b + c*x))/b^4]
    @test_int [(d + e*x)/(x^2*(b*x + c*x^2)^2), x, 2, -(d/(3*b^2*x^3)) + (2*c*d - b*e)/(2*b^3*x^2) - (c*(3*c*d - 2*b*e))/(b^4*x) - (c^2*(c*d - b*e))/(b^4*(b + c*x)) - (c^2*(4*c*d - 3*b*e)*log(x))/b^5 + (c^2*(4*c*d - 3*b*e)*log(b + c*x))/b^5]


    @test_int [x^6*(d + e*x)/(b*x + c*x^2)^3, x, 2, ((c*d - 3*b*e)*x)/c^4 + (e*x^2)/(2*c^3) + (b^3*(c*d - b*e))/(2*c^5*(b + c*x)^2) - (b^2*(3*c*d - 4*b*e))/(c^5*(b + c*x)) - (3*b*(c*d - 2*b*e)*log(b + c*x))/c^5]
    @test_int [x^5*(d + e*x)/(b*x + c*x^2)^3, x, 2, (e*x)/c^3 - (b^2*(c*d - b*e))/(2*c^4*(b + c*x)^2) + (b*(2*c*d - 3*b*e))/(c^4*(b + c*x)) + ((c*d - 3*b*e)*log(b + c*x))/c^4]
    @test_int [x^4*(d + e*x)/(b*x + c*x^2)^3, x, 2, (b*(c*d - b*e))/(2*c^3*(b + c*x)^2) - (c*d - 2*b*e)/(c^3*(b + c*x)) + (e*log(b + c*x))/c^3]
    @test_int [x^3*(d + e*x)/(b*x + c*x^2)^3, x, 2, -((c*d - b*e)/(2*c^2*(b + c*x)^2)) - e/(c^2*(b + c*x))]
    @test_int [x^2*(d + e*x)/(b*x + c*x^2)^3, x, 2, (c*d - b*e)/(2*b*c*(b + c*x)^2) + d/(b^2*(b + c*x)) + (d*log(x))/b^3 - (d*log(b + c*x))/b^3]
    @test_int [x^1*(d + e*x)/(b*x + c*x^2)^3, x, 2, -(d/(b^3*x)) - (c*d - b*e)/(2*b^2*(b + c*x)^2) - (2*c*d - b*e)/(b^3*(b + c*x)) - ((3*c*d - b*e)*log(x))/b^4 + ((3*c*d - b*e)*log(b + c*x))/b^4]
    @test_int [x^0*(d + e*x)/(b*x + c*x^2)^3, x, 2, -(d/(2*b^3*x^2)) + (3*c*d - b*e)/(b^4*x) + (c*(c*d - b*e))/(2*b^3*(b + c*x)^2) + (c*(3*c*d - 2*b*e))/(b^4*(b + c*x)) + (3*c*(2*c*d - b*e)*log(x))/b^5 - (3*c*(2*c*d - b*e)*log(b + c*x))/b^5]
    @test_int [(d + e*x)/(x^1*(b*x + c*x^2)^3), x, 2, -(d/(3*b^3*x^3)) + (3*c*d - b*e)/(2*b^4*x^2) - (3*c*(2*c*d - b*e))/(b^5*x) - (c^2*(c*d - b*e))/(2*b^4*(b + c*x)^2) - (c^2*(4*c*d - 3*b*e))/(b^5*(b + c*x)) - (2*c^2*(5*c*d - 3*b*e)*log(x))/b^6 + (2*c^2*(5*c*d - 3*b*e)*log(b + c*x))/b^6]


    #= ::Subsection::Closed:: =#
    #=Integrands*of*the*form*x^m*(A+B*x)*(b*x+c*x^2)^(p/2)=#


    #= ::Subsubsection::Closed:: =#
    #=p>0=#


    @test_int [x^3*(A + B*x)*sqrt(b*x + c*x^2), x, 7, (7*b^3*(3*b*B - 4*A*c)*(b + 2*c*x)*sqrt(b*x + c*x^2))/(512*c^5) - (7*b^2*(3*b*B - 4*A*c)*(b*x + c*x^2)^(3/2))/(192*c^4) + (7*b*(3*b*B - 4*A*c)*x*(b*x + c*x^2)^(3/2))/(160*c^3) - ((3*b*B - 4*A*c)*x^2*(b*x + c*x^2)^(3/2))/(20*c^2) + (B*x^3*(b*x + c*x^2)^(3/2))/(6*c) - (7*b^5*(3*b*B - 4*A*c)*atanh((sqrt(c)*x)/sqrt(b*x + c*x^2)))/(512*c^(11/2))]
    @test_int [x^2*(A + B*x)*sqrt(b*x + c*x^2), x, 6, -((b^2*(7*b*B - 10*A*c)*(b + 2*c*x)*sqrt(b*x + c*x^2))/(128*c^4)) + (b*(7*b*B - 10*A*c)*(b*x + c*x^2)^(3/2))/(48*c^3) - ((7*b*B - 10*A*c)*x*(b*x + c*x^2)^(3/2))/(40*c^2) + (B*x^2*(b*x + c*x^2)^(3/2))/(5*c) + (b^4*(7*b*B - 10*A*c)*atanh((sqrt(c)*x)/sqrt(b*x + c*x^2)))/(128*c^(9/2))]
    @test_int [x*(A + B*x)*sqrt(b*x + c*x^2), x, 4, (b*(5*b*B - 8*A*c)*(b + 2*c*x)*sqrt(b*x + c*x^2))/(64*c^3) - ((5*b*B - 8*A*c - 6*B*c*x)*(b*x + c*x^2)^(3/2))/(24*c^2) - (b^3*(5*b*B - 8*A*c)*atanh((sqrt(c)*x)/sqrt(b*x + c*x^2)))/(64*c^(7/2))]
